import React from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';


function App() {
    return ( 
        <div className='container'>
            <h1>Shakespeare</h1>
            <form action="">
                <div>
                    <input 
                    type="text" 
                    className='input-control' 
                    placeholder='Search' 
                    autoComplete='off' />
                    <button type="submit" className='bt'></button>
                </div>
            </form>
        </div>
     );
}

export default App;
